import React from "react"
import axios from "axios"
//import { BASE_URL } from "../asset/asset"




const BASE_URL = "http://localhost:8000/api/v1"

export const getsingleconsultation  = async ()=> {
    return await axios.get(BASE_URL + "/getallproduct",
    {
      method: 'GET',
      headers: {'Content-Type': 'application/json'}
    })
      .then(resp => resp.data)
  }


  export const getallconsultation  = async ()=> {
    return await axios.get(BASE_URL + "/getallproduct",
    {
      method: 'GET',
      headers: {'Content-Type': 'application/json'},
      Authorization: `Bearer ${"token"}`,
    })
      .then(resp => resp.data)
  }
  


   export const registerUser  =  (item) => {
   return axios.post(BASE_URL+"/registeruser",{
     method: 'POST',
     headers: {
        headers: {'Content-Type': 'application/json'},
      },
   })
     .then(data => data.json())
  }


  export const loginofficer  =  (item) => {
    return axios.post(BASE_URL +"/loginofficer", {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      item 
    })
      .then(data => data.json())
   }
